import React from "react";
import css from "@emotion/css";

const Home = () => {
  return (
    <React.Fragment>
      <section className="w-screen block clearfix">
        <div className="w-6/12 float-left bg-blue-100 h-screen">Left</div>
        <div className="w-6/12 float-right bg-blue-200">Right</div>
      </section>
    </React.Fragment>
  );
};

export default Home;
